import MenuBlocks from './MenuBlocks'

export default function Flyout ({
  items = [],
}) {
  return (
    <div className="absolute -ml-4 mt-3 transform w-screen max-w-md md:ml-6 md:transform md:-translate-x-1/2 lg:ml-0 lg:left-1/2 lg:-translate-x-1/2 lg:max-w-3xl xl:max-w-4xl">
      <div className="rounded-lg shadow-lg">
        <div className="rounded-lg shadow-xs overflow-hidden">
          <div className="z-20 relative grid gap-6 bg-white px-5 py-6 sm:gap-8 sm:p-8 lg:grid-cols-2">
            <MenuBlocks items={items} />
          </div>
        </div>
      </div>
    </div>
  )
}
